import {useState} from "react";
const SimpleGreet = ()=>{
	const [greet,setGreet] = useState("");
	const render = ()=>{
		const resp = fetch("http://localhost:8080/greet");
		setGreet(resp);
	}
	return(
		<div className="simple-greet">
			<p>The returned data is : {greet}</p>
		</div>
	)
}

export default SimpleGreet;
